 To generate new data points for the given specifications, let's first define a list of materials as follows:

```python
materials = ['plastic', 'polypropylene', 'polystyrene']
```

Next, we will create a list to store our generated samples with the specified features. We can use numpy library to easily generate random values for the given dimensions (25 x 7).

```python
import numpy as np

samples = np.zeros((25, 7))
```

We will now define functions to generate random values for each feature:

1. target_thickness: randomly chosen from a range of [30, 800] nm
2. pulse_width: uniform distribution between [0.1, 5] ns
3. energy: exponentially distributed with mean (1e19 to 4.64e21) for each material type
4. spot_size: normally distributed with a mean of 30um and standard deviation of 10um
5. intensity: uniformly distributed between [0.8, 1.2]
6. power: calculated from energy, pulse width and intensity (energy * (pulse_width * intensity))
7. cutoff_energy: exponentially distributed with mean (2e20 to 4e21) for each material type

```python
def random_thickness(material):
    if material == 'plastic':
        return np.random.uniform(low=30, high=800)
    elif material == 'polypropylene':
        return np.random.uniform(low=50, high=1200)
    else:  # polystyrene
        return np.random.uniform(low=100, high=1800)

def random_pulse_width():
    return np.random.uniform(low=0.1, high=5.0)

def random_energy(material):
    if material == 'plastic':
        return np.random.exponential(1e19)
    elif material == 'polypropylene':
        return np.random.exponential(2e19)
    else:  # polystyrene
        return np.random.exponential(4e19)

def random_spot_size():
    return np.random.normal(loc=30, scale=10)

def random_intensity():
    return np.random.uniform(low=0.8, high=1.2)

def random_power(energy, pulse_width, intensity):
    return energy * (pulse_width * intensity)

def random_cutoff_energy(material):
    if material == 'plastic':
        return np.random.exponential(2e20)
    elif material == 'polypropylene':
        return np.random.exponential(3e20)
    else:  # polystyrene
        return np.random.exponential(4e20)
```

Now, we can use these functions to fill the samples array with generated data points:

```python
for i in range(samples.shape[0]):
    material = materials[np.random.randint(len(materials))]
    thickness = random_thickness(material)
    pulse_width = random_pulse_width()
    energy = random_energy(material)
    spot_size = random_spot_size()
    intensity = random_intensity()
    power = random_power(energy, pulse_width, intensity)
    cutoff_energy = random_cutoff_energy(material)

    samples[i] = [material, thickness, pulse_width, energy, spot_size, intensity, power, cutoff_energy]
```

Here's the final output, a complete array of 25 samples with the required features:

```python
print(samples)
```

